import React from 'react';
import { connect } from 'react-redux';
import Pagination from '../components/Pagination';
import { setPage } from '../modules/pagination.js';

const PaginationContainer = ({ postsPerPage, totalPosts, setPage }) => {
    return(
        <Pagination postsPerPage={postsPerPage} totalPosts={totalPosts} setPage={setPage}/>
    );
};

export default connect(
    ({ Pagination }) => ({
        // <GameList>의 props
        gameList: gameList.gameList,
        loadingGameList: loading['gameList/GET_GAMELIST'],
        select: tag.selectedTags
    }),
    {
        setPage,
    }
)(PaginationContainer);
